--- Raw source ---
(direction, position, size) {
		const positionX = position % this.#width;
		const positionY = Math.floor(position / this.#width);
		const moves = [];
		const isFree = (x, y) => {
			if(x < 0 || x >= this.#width || y < 0 || y >= this.#height)
				return false;
			const index = y * this.#width + x;
			return this.#fields[index] == FIELD_EMPTY;
		};
		let maxSteps = Math.max(this.#width, this.#height);
		for(let step = 1; step <= maxSteps; step++) {
			let x, y;
			if(direction == HORIZONTAL) {
				x = positionX + size - 1 + step;
				y = positionY;
			}
			if(direction == VERTICAL) {
				x = positionX;
				y = positionY + size - 1 + step;
			}
			if(!isFree(x, y))
				break;
			moves.push(step);
		}
		for(let step = 1; step <= maxSteps; step++) {
			let x, y;
			if(direction == HORIZONTAL) {
				x = positionX - step;
				y = positionY;
			}
			if(direction == VERTICAL) {
				x = positionX;
				y = positionY - step;
			}
			if(!isFree(x, y))
				break;
			moves.push(-step);
		}
		return moves;
	}

